column28:
Hi , 
 
GRPS is transitioning to AMEBA-RDX GraphQL for AOMA - GRPS Publish readiness info and will discontinue using legacy WebService. GraphQL returns the same info in JSON format with identical rules.
 
This is available in production for testing, but it has not been used yet. Could you please test this GQL for Publish cases and share the results? We already compared XML to JSON in the stage environment, and everything works as expected.
 
You can open the following links in a web browser, access granted to Asburry team 
 
Dev : [https://ameba-stage-gw.smcdp-aws.net/ameba-gql/graphiql?path=/ameba-gql/graphql]
PROD : [https://ameba-gw.smcdp-aws.net/ameba-gql/graphiql?path=/ameba-gql/graphql]
 

!image-2025-05-20-14-06-26-914.png|width=1780,id=id-594EB10E-20B4-4D61-8DAC-6282A0C2EE74!
Query 
 
{code:java}
query PublishReadyInfo{
  aomaPublishReadyInfo(productNumbers: "G010003235274V") {
    productNumber
    isOpenPublishReady
    isFullPublishReady
    messages
    details {
      trackNo
      trackExt
      trackIdnum
      isOpenPublishReady
      isFullPublishReady
      messages
    }
  }
}
{code}

